import React, { useEffect, useState } from "react";
import axios from "axios";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

const API_URL = "http://localhost:5000/books";

const Home = () => {
    const [books, setBooks] = useState([]);

    useEffect(() => {
        axios.get(API_URL).then((response) => {
            setBooks(response.data);
        });
    }, []);

    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold">ðŸ“š Library Management System</h1>
            <Link to="/add" className="bg-blue-500 text-white px-4 py-2 mt-4 inline-block rounded">+ Add Book</Link>
            <table className="mt-4 w-full border-collapse border border-gray-300">
                <thead>
                    <tr className="bg-gray-200">
                        <th className="border p-2">ID</th>
                        <th className="border p-2">Title</th>
                        <th className="border p-2">Author</th>
                        <th className="border p-2">Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {books.map((book) => (
                        <tr key={book.id} className="border">
                            <td className="border p-2">{book.id}</td>
                            <td className="border p-2">{book.title}</td>
                            <td className="border p-2">{book.author}</td>
                            <td className="border p-2">
                                <button onClick={() => handleDelete(book.id)} className="bg-red-500 text-white px-2 py-1 rounded">Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

const AddBook = () => {
    const [title, setTitle] = useState("");
    const [author, setAuthor] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.post(API_URL, { title, author }).then(() => {
            window.location.href = "/";
        });
    };

    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold">âž• Add a New Book</h1>
            <form onSubmit={handleSubmit} className="mt-4">
                <input type="text" placeholder="Title" className="border p-2 block w-full" value={title} onChange={(e) => setTitle(e.target.value)} required />
                <input type="text" placeholder="Author" className="border p-2 block w-full mt-2" value={author} onChange={(e) => setAuthor(e.target.value)} required />
                <button type="submit" className="bg-green-500 text-white px-4 py-2 mt-4 rounded">Add Book</button>
            </form>
        </div>
    );
};

const handleDelete = (id) => {
    axios.delete(`${API_URL}/${id}`).then(() => {
        window.location.reload();
    });
};

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/add" element={<AddBook />} />
            </Routes>
        </Router>
    );
};

export default App;
